
create table applications_credit (id int8 generated by default as identity, application_status int4 not null, datetime_creation timestamp, loan_annual_rate numeric(19, 2) not null, loan_term int4 not null, monthly_income numeric(19, 2) not null, purpose_of_loan varchar(255) not null, total_sum numeric(19, 2) not null, client_id int8, primary key (id));
create table users (id int8 generated by default as identity, date_of_birth date not null, first_name varchar(255) not null, surname varchar(255) not null, login varchar(255) not null, password varchar(255) not null, patronymic varchar(255) not null, user_role int4, primary key (id));
alter table if exists users add constraint UK_ow0gan20590jrb00upg3va2fn unique (login);
alter table if exists applications_credit add constraint client_id foreign key (client_id) references users;
